import React from 'react'
import PropTypes from 'prop-types';
//
import { Container, Row, Col } from 'react-bootstrap';

export const Messages = ({ msgs }) => {
    console.log({ ...msgs });
    // console.log(description); // subject: 'sub', issueDate: 'date', description:

    if (msgs.length < 1) { return (<div></div>) }

    return (
        <Container className="messages-container" >
            {
                msgs.map((msg) => {
                    return (
                        <Container>
                            <Row className="mb-10" border="secondary" style={{ width: '18rem' }}>
                                <Col sm={3}>
                                    date
                                </Col>
                                <Col sm={8}>
                                    message
                                </Col>
                            </Row>
                            <Row className="mb-10" border="secondary" style={{ width: '18rem' }}>
                                <Col sm={8}>
                                    message
                                </Col>
                                <Col sm={3}>
                                    date
                                </Col>
                            </Row>
                        </Container>
                    )
                })
            }

        </Container>
    )
}

Messages.propTypes = {
    msg: PropTypes.array.isRequired,
    // subject: PropTypes.string.isRequired 
    // onSubmit: PropTypes.func.isRequired,
}
